 public IEnumerator VaultLerpToPosition(RaycastHit forwardHit, RaycastHit secondHit, float time)
    {
        isVaulting = true;

        float timer = 0;
        
        if (Physics.Raycast(slopeDetectorTransform.position, -forwardHit.normal, out RaycastHit realineToFence, 10, vaultLayerMask))
        {
            Vector3 forwardDir = (realineToFence.point - transform.position).normalized;
            forwardDir.y = 0;
            Quaternion forwardRotation = Quaternion.LookRotation(forwardDir);

            Quaternion fenceRotatonNormal = Quaternion.LookRotation(-forwardHit.normal);
            
            transform.rotation = Quaternion.Slerp(transform.rotation, fenceRotatonNormal, Time.deltaTime * 100000);
            
            while (Vector2.Distance(new Vector2(transform.position.x, transform.position.z),
                       new Vector2(realineToFence.point.x, realineToFence.point.z)) > 0.75f && timer < 2)
            {
                transform.rotation = Quaternion.Slerp(transform.rotation, forwardRotation, Time.deltaTime * 20f);
                AutoMove(transform.forward.normalized * 2, false, false);

                timer += Time.deltaTime;
                yield return new WaitForEndOfFrame();
            }
        }

        timer = 0;
        PS_GameManager.instance.playerAnimator.SetTrigger("Vault");

        forwardHit.collider.enabled = false;
        
        Vector3 sphereCastOrigin = forwardHit.point;
        Vector3 sphereCastDirection = transform.forward; // or any other direction you find appropriate

        RaycastHit sphereHitInfo;

        var hits = Physics.SphereCastAll(sphereCastOrigin, 2, Vector3.forward, 2, vaultLayerMask);

        foreach (var h in hits)
        {
            if (h.collider.GetComponent<Terrain>() != null)
            {
                continue;
            }
            
            h.collider.enabled = false;
            Debug.Log("SphereCast hit: " + h.collider.name);
        }

        while (timer < time)
        {
            //transform.rotation = Quaternion.Slerp(transform.rotation, forwardRotation, Time.deltaTime * 20f);
            timer += Time.deltaTime;
            yield return new WaitForEndOfFrame();
        }

        foreach (var h in hits)
        {
            if (h.collider != null)
            {
                h.collider.enabled = true;
            }
        }
        
        
        
        forwardHit.collider.enabled = true;
        isVaulting = false;
    }

using System.Collections;

using UnityEngine;

public class Weapon : MonoBehaviour
{
	public Transform firePoint;
	public GameObject bulletPrefab;
	public float fireRate = 0.5f;
	public int magazineSize = 30;
	public float reloadTime = 2f;
	public int damage = 10;
	public ParticleSystem partSystem;
	public int currentAmmo;
	public Animator anim;
	private bool isReloading = false;
	private float nextFireTime = 1f;

	private void Start()
	{
		currentAmmo = magazineSize;
	}

	private void Update()
	{
		if (isReloading)
			return;

		if (Input.GetButton("Fire1"))
		{
			if (currentAmmo > 0 && Time.time >= nextFireTime)
			{
				nextFireTime = Time.time + fireRate;
				Shoot();
				anim.SetTrigger("Shoot");
			}
			else
			{
				StartCoroutine(Reload());
			}
		}

		if (Input.GetButtonDown("Reload") && currentAmmo < magazineSize)
		{
			anim.SetTrigger("Reload");
			StartCoroutine(Reload());
			nextFireTime = Time.time + fireRate;
		}
	}

	private void Shoot()
	{
		// Создаем пулю
		GameObject bullet = Instantiate(bulletPrefab, firePoint.position, firePoint.rotation);

		// Получаем компонент "Target" из префаба пули
		Target target = bullet.GetComponent<Target>();

		// Если у цели есть компонент "Target", наносим урон
		if (target != null)
		{
			target.TakeDamage(damage);
			Debug.Log("Bullet hit target!");
		}
		else
		{
			Debug.Log("Bullet did not hit target. Target component not found.");
		}

		// Уменьшаем количество патронов
		currentAmmo--;

		// Уничтожаем пулю через некоторое время (предотвращение утечек памяти)
		Destroy(bullet, 2f);
	}

	private IEnumerator Reload()
	{
		isReloading = true;
		// Ждем время перезарядки
		yield return new WaitForSeconds(reloadTime);

		// Перезаряжаем оружие
		currentAmmo = magazineSize;
		isReloading = false;
	}
}

