import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
    const [themeMode, setThemeMode] = useState<string>();

    const handleThemeChangeClick = () => {
        if (localStorage.getItem("theme") === "light") {
            localStorage.setItem("theme", "dark");
        } else {
            localStorage.setItem("theme", "light");
        }
        window.postMessage({ type: "themeChange" }, window.location.href);
    };

    useEffect(() => {
        const handleStorageChange = () => {
            setThemeMode(localStorage.getItem("theme") || "light");
        };

        handleStorageChange();

        window.addEventListener("storage", handleStorageChange);
        window.addEventListener("message", (event) => {
            if (event.data && event.data.type === "themeChange") {
                handleStorageChange();
            }
        });

        return () => {
            window.removeEventListener("storage", handleStorageChange);
            window.removeEventListener("message", handleStorageChange);
        };
    }, []);

    return (
        <div>
            <button onClick={handleThemeChangeClick}>Change theme</button>
            <div>{themeMode}</div>
        </div>
    );
}

export default App;

