#include <iostream>

int powModulu(int a, int b, int m);

int main()
{
   int a = 271;
   int b = 321;
   int m = 481;
   std::cout << powModulu(a, b, m) << std::endl;
}

int powModulu(int a, int b, int m)
{
   int res = 1;
   int rollingModulu = a % m;

   // b is the exponent
   while (b)
   {
      if (b & 1)
      {
         res = (res * rollingModulu) % m;
      }
      rollingModulu = (rollingModulu * rollingModulu) % m;

      b >>= 1;
   }

   return res;
}
